SET NOCOUNT ON;
INSERT INTO [Products] ([description], [model], [name], [price])
VALUES (@p0, @p1, @p2, @p3);
SELECT [id]
FROM [Products]
WHERE @@ROWCOUNT = 1 AND [id] = scope_identity();

